"    <div id=\"topicTitle\">",
"     Patient information: Shoulder impingement (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/shoulder-impingement-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H21281298\">",
"      <span class=\"h1\">",
"       What is shoulder impingement?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Shoulder impingement is a condition that causes pain in the shoulder. It happens when a tendon or bursa in the shoulder gets squeezed between the bones that make up the shoulder. A tendon is a strong band of tissue that connects a muscle to a bone. A bursa is a small fluid-filled sac that sits near a bone.",
"     </p>",
"     <p>",
"      People can get shoulder impingement if they do a lot of work or a sport that involves stretching or lifting the arms overhead.",
"     </p>",
"     <p>",
"      Shoulder impingement can lead to other problems, such as bursitis, which is when a bursa gets irritated or swollen.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21281305\">",
"      <span class=\"h1\">",
"       What are the symptoms of shoulder impingement?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people have pain in the front of the shoulder. The pain is usually worse with lifting and reaching movements.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21281312\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You might. Your doctor or nurse will talk with you and do an exam. He or she might also do an X-ray of your shoulder.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21281319\">",
"      <span class=\"h1\">",
"       How is shoulder impingement treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In most cases, the condition will get better on its own, but it can take weeks to months. To help your shoulder get better, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Rest your shoulder &mdash; Avoid reaching overhead or across your chest, lifting, leaning on your elbows, or lying on your shoulder.",
"       </li>",
"       <li>",
"        Ice your shoulder &mdash; Put a cold gel pack, bag of ice, or bag of frozen vegetables on the injured area every 1 to 2 hours, for 15 minutes each time. Put a thin towel between the ice (or other cold object) and your skin.",
"       </li>",
"       <li>",
"        Take a pain-relieving medicine &mdash; Ask your doctor or nurse about taking an over-the-counter medicine, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"         acetaminophen",
"        </a>",
"        (sample brand name: Tylenol&reg;),",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;), or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sample brand names: Aleve&reg;, Naprosyn&reg;).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21281326\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Different exercises can help your shoulder get better.",
"     </p>",
"     <p>",
"      To keep your shoulder from getting too stiff, you can do an exercise called the pendulum stretch. To do this exercise, let your arm relax and hang down while you sit or stand. Move your arm back and forth, then side to side, and then around in small circles (",
"      <a class=\"graphic graphic_figure graphicRef50148 \" href=\"UTD.htm?12/37/12895\">",
"       figure 1",
"      </a>",
"      ). Try to do this exercise for 5 minutes, 1 or 2 times a day.",
"     </p>",
"     <p>",
"      Other types of exercises can help make the shoulder muscles stronger. Your doctor, nurse, or physical therapist (exercise expert) can show you how to do these types of exercises. He or she will tell you when to start them and how often to do them.",
"     </p>",
"     <p>",
"      When you do shoulder exercises, it&rsquo;s important to:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Warm up your shoulder first by taking a hot shower or bath.",
"       </li>",
"       <li>",
"        Start slowly and make the exercises harder over time.",
"       </li>",
"       <li>",
"        Know that some soreness is normal. If you have sharp or tearing pain, stop what you&rsquo;re doing and let your doctor or nurse know.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21281333\">",
"      <span class=\"h1\">",
"       What if my symptoms don&rsquo;t get better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your symptoms don&rsquo;t get better, talk with your doctor or nurse about other possible treatments, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Getting a shot of medicine into the shoulder",
"       </li>",
"       <li>",
"        Surgery",
"       </li>",
"      </ul>",
"     </p>",
