"      Cozaar (AU, BB, BE, BM, BR, BS, BZ, CL, CN, CR, CZ, DK, EE, ES, FI, FR, GB, GR, GT, GY, HK, HN, HR, HU, ID, IE, JM, KP, LU, MT, MX, MY, NI, NL, NO, NZ, PA, PE, PH, PK, PL, PT, RU, SE, SG, SK, SR, SV, TH, TR, TT, TW, VE);",
"     </li>",
