"     </li>",
"     <li>",
"      Ecozar (PH);",
"     </li>",
"     <li>",
"      Insaar (ID);",
"     </li>",
"     <li>",
"      Lasa (TW);",
"     </li>",
"     <li>",
"      Lifezar (PH);",
"     </li>",
"     <li>",
"      Loranta (TH);",
"     </li>",
"     <li>",
"      Lortaan (IT);",
"     </li>",
"     <li>",
"      Lorzaar (DE);",
"     </li>",
