"   </div>",
"   <div class=\"lgnd\">",
"    Multiple excoriations and prominent hyperpigmentation in a patient with pediculosis corporis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
