"   <div class=\"ttl\">",
"    Pediculosis corporis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 256px; height: 392px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Body lice infestation of long duration can lead to hyperpigmentation and excoriations. Lesions tend to be concentrated in areas where clothing seams contact the skin.",
