var title_f25_35_26173="Nitroprusside in RA stenosis";
var content_f25_35_26173=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F75208&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F75208&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Nitroprusside can lower GFR in bilateral renal artery stenosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 357px; height: 214px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect on the glomerular filtration rate (GFR) of lowering the systemic blood pressure with increasing doses of nitroprusside in patients with unilateral (squares) and severe bilateral (circles) renal artery stenosis. The GFR remained relatively stable with unilateral disease but fell substantially with bilateral involvement. In the latter setting, renal perfusion pressure distal to the stenotic lesions presumably fell below the autoregulatory range despite the lack of interference with angiotensin II.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Textor SC, Novick AC, Tarazi RC, et al. Ann Intern Med 1985; 102:308.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
